import { useSelector } from 'react-redux'

export default function Cart() {
    var cartItem = useSelector((state)=>state.cart.cartItem)
  return (
    <div>
        <h1>cart</h1>
        {
            cartItem.map((ele, ind)=>{
                return  <h1>{ind} -  </h1>
            })
        }
    </div>
  )
}
